CSG_Totals_Header.query:
--CSG QUERY 

MasterHierarchy = load &quot;Master_Hierarchy_GM&quot;;
MasterHierarchy = filter MasterHierarchy by &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;Master_l1&quot;).asString()}}&#39; in  {{cell(Static_Cloud_Filter.selection,0,&quot;filter&quot;).asString()}};
-------------------LOAD ACV-------------------------------------

ACV = load &quot;APM_ACV&quot;;
ACV = filter ACV by {{column(Cloud_2_1.selection,[&quot;Cloud_2&quot;]).asEquality(&#39;Cloud_2&#39;)}};
ACV = filter ACV by {{column(Filter_Lead.selection,[&quot;Lead&quot;]).asEquality(&#39;Lead&#39;)}};

ACV = filter ACV by &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39; in {{cell(Static_Cloud_Filter.selection,0,&quot;filter&quot;).asString()}};
ACV = group ACV by (&#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39;,&#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_2&quot;).asString()}}&#39;, &#39;Quarter&#39;, &#39;Month&#39;, &#39;Fiscal_Year&#39;, &#39;Region&#39;, &#39;Country&#39;, &#39;Subcloud&#39;, &#39;Cloud_2&#39;);

ACV = foreach ACV generate &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39; as &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39;, 
&#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_2&quot;).asString()}}&#39; as &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_2&quot;).asString()}}&#39;, 
&#39;Quarter&#39; as &#39;Quarter&#39;, &#39;Fiscal_Year&#39; as &#39;Fiscal_Year&#39; , &#39;Month&#39; as &#39;Month&#39;, &#39;Region&#39; as &#39;Region&#39;, &#39;Subcloud&#39;, &#39;Cloud_2&#39;, sum(&#39;ACV&#39;) as &#39;ACV&#39;,
{{cell(Static_Cloud_Filter.selection,0,&quot;static_country_logic&quot;).asString()}} as &#39;Country&#39;;  

--ACV = filter ACV by  {{column(lens_1.selection,[&quot;Country&quot;]).asEquality(&#39;Country&#39;)}};

ACV_SuccessPlans = filter ACV by &#39;Subcloud&#39; == &quot;Success Plans&quot;;
Advisory_Bookings = filter ACV by &#39;Subcloud&#39; == &quot;Advisory&quot;;
Project_Bookings = filter ACV by &#39;Subcloud&#39; == &quot;Projects&quot;;

----------------------------FILTER ACV--------------------------------------------
q2_CYACV = filter ACV_SuccessPlans by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q2_PYACV = filter ACV_SuccessPlans by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_CYACV = filter ACV_SuccessPlans by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;YTD_Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_PYACV = filter ACV_SuccessPlans by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;YTD_Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};

q2_CYACV_a = filter Advisory_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q2_PYACV_a = filter Advisory_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_CYACV_a = filter Advisory_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;YTD_Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_PYACV_a = filter Advisory_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;YTD_Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};

q2_CYACV_p = filter Project_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q2_PYACV_p = filter Project_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_CYACV_p = filter Project_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;YTD_Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_PYACV_p = filter Project_Bookings by &#39;Month&#39; in  {{cell(Selector_Quarter.selection,0,&quot;YTD_Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};


---------------------LOAD AOV----------------------------------------
AOV = load &quot;APM_AOV&quot;;
AOV = filter AOV by &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39; in {{cell(Static_Cloud_Filter.selection,0,&quot;filter&quot;).asString()}};
AOV = filter AOV by {{column(Filter_Lead.selection,[&quot;Lead&quot;]).asEquality(&#39;Lead&#39;)}};
AOV = filter AOV by {{column(Cloud_2_1.selection,[&quot;Cloud_2&quot;]).asEquality(&#39;Cloud_2&#39;)}};

--SPECIFIC FILTER FOR SUCCESS PLAN AOV
AOV = filter AOV by &#39;Subcloud&#39; == &quot;Success Plans&quot;;

AOV = foreach AOV generate &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39; as &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_1&quot;).asString()}}&#39;, 
&#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_2&quot;).asString()}}&#39; as &#39;{{cell(Static_Cloud_Filter.selection,0,&quot;level_2&quot;).asString()}}&#39;, 
&#39;Quarter&#39; as &#39;Quarter&#39;, &#39;Fiscal_Year&#39; as &#39;Fiscal_Year&#39;,&#39;Month&#39; as &#39;Month&#39;, &#39;Region&#39; as &#39;Region&#39;, sum(&#39;AOV&#39;) as &#39;AOV&#39;,
{{cell(Static_Cloud_Filter.selection,0,&quot;static_country_logic&quot;).asString()}} as &#39;Country&#39;; 

--AOV = filter AOV by  {{column(lens_1.selection,[&quot;Country&quot;]).asEquality(&#39;Country&#39;)}}

-----------------------------FILTER AOV ---------------------------------------
q2_CYAOV = filter AOV by &#39;Month&#39; in {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q2_PYAOV = filter AOV by &#39;Month&#39; in {{cell(Selector_Quarter.selection,0,&quot;Month&quot;).asString()}}  &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_CYAOV = filter AOV by &#39;Month&#39; in {{cell(Selector_Quarter.selection,0,&quot;YTD_Month_cum&quot;).asString()}} &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;CY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};
q3_PYAOV = filter AOV by &#39;Month&#39; in {{cell(Selector_Quarter.selection,0,&quot;YTD_Month_cum&quot;).asString()}} &amp;&amp; {{cell(Fiscal_Year_1.selection,0,&quot;PY&quot;).asEquality(&#39;Fiscal_Year&#39;)}};


---------------------------------Grouping-------------------------------------------------------------------------------------------------------------------------------------------
result = group 
q2_CYACV by all full, 
q2_PYACV by all full, 
q3_CYACV by all full, 
q3_PYACV by all full, 

q2_CYAOV by all full, 
q2_PYAOV by all full, 
q3_CYAOV by all full, 
q3_PYAOV by all full,

q2_CYACV_a by all full,
q2_PYACV_a by all full,
q3_CYACV_a by all full,
q3_PYACV_a by all full,

q2_CYACV_p by all full,
q2_PYACV_p by all full,
q3_CYACV_p by all full,
q3_PYACV_p by all
;



------------------------PROJECTION------------------------

result = foreach result generate  

coalesce(sum(q2_CYACV.&#39;ACV&#39;), 0) as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan ACV Absolute&#39;, 
coalesce(sum(q3_CYACV.&#39;ACV&#39;), 0) as &#39;YTD Success Plan ACV Absolute&#39;, 
((coalesce(sum(q2_CYACV.&#39;ACV&#39;), 0) - coalesce(sum(q2_PYACV.&#39;ACV&#39;), 0)) / coalesce(sum(q2_PYACV.&#39;ACV&#39;), 0)) * 100 as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Success Plan ACV Growth&#39;, 
((coalesce(sum(q3_CYACV.&#39;ACV&#39;), 0) - coalesce(sum(q3_PYACV.&#39;ACV&#39;), 0)) / coalesce(sum(q3_PYACV.&#39;ACV&#39;), 0)) * 100 as &#39;YTD Success Plan ACV Growth&#39;, 

coalesce(sum(q2_CYAOV.&#39;AOV&#39;), 0) as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan AOV Absolute&#39;, 
coalesce(sum(q3_CYAOV.&#39;AOV&#39;), 0) as &#39;YTD Success Plan AOV Absolute&#39;, 
((coalesce(sum(q2_CYAOV.&#39;AOV&#39;), 0) - coalesce(sum(q2_PYAOV.&#39;AOV&#39;), 0)) / coalesce(sum(q2_PYAOV.&#39;AOV&#39;), 0)) * 100 as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Success Plan AOV Growth&#39;, 
((coalesce(sum(q3_CYAOV.&#39;AOV&#39;), 0) - coalesce(sum(q3_PYAOV.&#39;AOV&#39;), 0)) / coalesce(sum(q3_PYAOV.&#39;AOV&#39;), 0)) * 100 as &#39;YTD Success Plan AOV Growth&#39;,

coalesce(sum(q2_CYACV_a.&#39;ACV&#39;), 0) as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Advisory ACV Absolute&#39;, 
coalesce(sum(q3_CYACV_a.&#39;ACV&#39;), 0) as &#39;YTD Advisory ACV Absolute&#39;, 
((coalesce(sum(q2_CYACV_a.&#39;ACV&#39;), 0) - coalesce(sum(q2_PYACV_a.&#39;ACV&#39;), 0)) / coalesce(sum(q2_PYACV_a.&#39;ACV&#39;), 0)) * 100 as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Advisory ACV Growth&#39;, 
((coalesce(sum(q3_CYACV_a.&#39;ACV&#39;), 0) - coalesce(sum(q3_PYACV_a.&#39;ACV&#39;), 0)) / coalesce(sum(q3_PYACV_a.&#39;ACV&#39;), 0)) * 100 as &#39;YTD Advisory ACV Growth&#39;,

coalesce(sum(q2_CYACV_p.&#39;ACV&#39;), 0) as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Project ACV Absolute&#39;, 
coalesce(sum(q3_CYACV_p.&#39;ACV&#39;), 0) as &#39;YTD Project ACV Absolute&#39;, 
((coalesce(sum(q2_CYACV_p.&#39;ACV&#39;), 0) - coalesce(sum(q2_PYACV_p.&#39;ACV&#39;), 0)) / coalesce(sum(q2_PYACV_p.&#39;ACV&#39;), 0)) * 100 as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Project ACV Growth&#39;, 
((coalesce(sum(q3_CYACV_p.&#39;ACV&#39;), 0) - coalesce(sum(q3_PYACV_p.&#39;ACV&#39;), 0)) / coalesce(sum(q3_PYACV_p.&#39;ACV&#39;), 0)) * 100 as &#39;YTD Project ACV Growth&#39;

;


------------FINAL PROJECTION----------------------------------------------------------------------

result = foreach result generate &quot;TOTAL                   &quot; as &#39;Lead_1&#39;, 

&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan ACV Absolute&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan ACV Absolute&#39;, 
&#39;YTD Success Plan ACV Absolute&#39; as &#39;YTD Success Plan ACV Absolute&#39;, 
&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Success Plan ACV Growth&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan ACV Growth&#39;, 
&#39;YTD Success Plan ACV Growth&#39; as &#39;YTD Success Plan ACV Growth&#39;, 

&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan AOV Absolute&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan AOV Absolute&#39;,
&#39;YTD Success Plan AOV Absolute&#39; as &#39;YTD Success Plan AOV Absolute&#39;, 
&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Success Plan AOV Growth&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Success Plan AOV Growth&#39;, 
&#39;YTD Success Plan AOV Growth&#39; as &#39;YTD Success Plan AOV Growth&#39;,

&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Advisory ACV Absolute&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Advisory ACV Absolute&#39;, 
&#39;YTD Advisory ACV Absolute&#39; as &#39;YTD Advisory ACV Absolute&#39;, 
&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Advisory ACV Growth&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Advisory ACV Growth&#39;, 
&#39;YTD Advisory ACV Growth&#39; as &#39;YTD Advisory ACV Growth&#39;,

&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Project ACV Absolute&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Project ACV Absolute&#39;, 
&#39;YTD Project ACV Absolute&#39; as &#39;YTD Project ACV Absolute&#39;, 
&#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_rate&quot;).asString()}} Project ACV Growth&#39; as &#39;{{cell(Selector_Quarter.selection,0,&quot;Header_name_absolute&quot;).asString()}} Project ACV Growth&#39;, 
&#39;YTD Project ACV Growth&#39; as &#39;YTD Project ACV Growth&#39;

;

Filter_Lead.query:
q = load &quot;APM_ACV&quot;;
q = group q by (&#39;Lead&#39;);
q = foreach q generate case when &#39;Lead&#39; == &quot;Tony Owens&quot; then &quot;1. Tony Owens&quot; when &#39;Lead&#39; == &quot;Warren Wick&quot; then &quot;2. Warren Wick&quot; when &#39;Lead&#39; == &quot;Andrew Kofoid&quot; then &quot;3. Andrew Kofoid&quot; when &#39;Lead&#39; == &quot;Miguel Milano&quot; then &quot;4. Miguel Milano&quot; when &#39;Lead&#39; == &quot;Mark Innes&quot; then &quot;5. Mark Innes&quot; when &#39;Lead&#39; == &quot;Shinichi Koide&quot; then &quot;6. Shinichi Koide&quot; when &#39;Lead&#39; == &quot;Dave Rey&quot; then &quot;7. Dave Rey&quot; when &#39;Lead&#39; == &quot;Enrique Ortegon&quot; then &quot;8. Enrique Ortegon&quot;else &quot;9. unkown&quot; end as Lead_Rank  ,&#39;Lead&#39; as &#39;Lead&#39;, count() as &#39;count&#39;;
q = order q by &#39;Lead_Rank&#39; asc;
