Filter_Cloud.query:
q = load &quot;APM_ACV&quot;;
q = group q by (&#39;Cloud&#39;);
q = foreach q generate case when &#39;Cloud&#39; == &quot;Sales Cloud &amp; Sales Platform&quot; then &quot;A. Sales Cloud &amp; Sales Platform&quot; when &#39;Cloud&#39; == &quot;Service Cloud &amp; Service Cloud Platform&quot; then &quot;B. Service Cloud &amp; Service Cloud Platform&quot; when &#39;Cloud&#39; == &quot;Marketing Cloud &amp; Marketing Platform&quot; then &quot;C. Marketing Cloud &amp; Marketing Platform&quot; when &#39;Cloud&#39; == &quot;Commerce Cloud&quot; then &quot;D. Commerce Cloud&quot; when &#39;Cloud&#39; == &quot;Salesforce Platform(s)&quot; then &quot;E. Salesforce Platform(s)&quot; when &#39;Cloud&#39; == &quot;Quip&quot; then &quot;F. Quip&quot; when &#39;Cloud&#39; == &quot;Other&quot; then &quot;G. Other&quot;when &#39;Cloud&#39; == &quot;Other CSG&quot; then &quot;H. Other CSG&quot; when &#39;Cloud&#39; == &quot;Premier (a la carte)&quot; then &quot;I. Premier (a la carte)&quot;  when &#39;Cloud&#39; == &quot;Success Cloud&quot; then &quot;J. Success Cloud&quot;else &quot;K. unkown&quot; end as Cloud_Rank  ,&#39;Cloud&#39; as &#39;Cloud&#39;, count() as &#39;count&#39;;
